import React from 'react'

function Contactus() {
  return (
    <div>
      
      <h1 className='titleheader' style={{ color: "black", textAlign: "center" }}>Feel Free to find us at:</h1>
      
      <p style={{backgroundColor:"white", width:"100%"}}><span style={{fontWeight:"bold"}}>Contact us by Whatapps: </span> 0109829065
      </p>

      

      <iframe width="600" height="500" className='gmap_canvas' src="https://maps.google.com/maps?q=bintulu%20bukit%20orang&t=&z=13&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0">


      </iframe>


    </div>



  )
}

export default Contactus
